import React from 'react';
// import './About.css';

const Home = () => {
  return (
<section id="home">
            <h1 class="hi" id="welcome-section">Welcome to My Portfolio</h1>
            <p id="name">Hi, I'm Arwa Zakria</p>
            <p id="job" class="animate__animated animate__fadeIn ">a web developer...</p>
</section>
  );
};

export default Home;
